import { useNavigate } from "react-router-dom";
import style from './GridItem.module.css';

export default function GridItem({ produto }) {
    const navigate = useNavigate();

    const handleMove = () => {
        navigate(`/MovimentarProduto/${produto.id}`);
    };

    return (
        <li className={style.item}>
            <span>Código EAN:{produto.ean}<br/> Nome: {produto.nome}<br/> Preço: R${produto.preco} <br/>Categoria: {produto.categoria} <br/>Quantidade: {produto.quantidade}</span>
            <button onClick={handleMove}>Movimentar</button>
        </li>
    );
}
